module CLex
# 1 "CLex.fsl"
 
 (* File MicroC/CLex.lex
    Lexer specification for micro-C, a small imperative language
  *)

// module CLex = 
  
open FSharp.Text.Lexing
open CPar  // Token 的定义位于语法分析模块中

// 辅助函数，从lexbuf 得到当前的 词元字符串，lexeme 
let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)
// keyword 处理关键字与标识符的辅助函数
let keyword s =   
    match s with
    | "Char"    -> CHAR    // 返回对应的Token ,Token 定义于 CPar.fsl 文件中
    | "char"    -> TOCHAR
    | "Bool"    -> BOOL
    | "else"    -> ELSE
    | "false"   -> CSTBOOL false
    | "if"      -> IF
    | "Int"     -> INT
    | "int"     -> TOINT
    | "String"  -> STRING
    | "null"    -> NULL
    | "print"   -> PRINT
    | "return"  -> RETURN
    | "for"     -> FOR
    | "true"    -> CSTBOOL true
    | "Void"    -> VOID 
    | "while"   -> WHILE  
    | "Float"   -> FLOAT 
    | "float"   -> TOFLOAT
    | "until"   -> UNTIL  
    | "dountil" -> DOUNTIL
    | "dowhile" -> DOWHILE 
    | "do"      -> DO  
    | "with"    -> WITH
    | "match"   -> MATCH
    | "switch"  -> SWITCH
    | "case"    -> CASE
    | "break"   -> BREAK 
    | "in"      -> IN
    | "try"     -> TRY
    | "catch"   -> CATCH
    | "throw"   -> THROW
    | "continue"-> CONTINUE
    | "default" -> DEFAULT
    | "Struct"  -> STRUCT
    | "println" -> PRINTLN
    | "createI" -> CREATEI
    | "typeOf"  -> TYPEOF
    | "sizeOf"  -> SIZEOF
    | _         -> NAME s   // 缺省情况，是标识符的名字，如 函数名，变量名等
                            // 当所有的关键字没有匹配成功时，则当成标识符
// 字符串转义符处理函数
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

